import{_ as i,o as e,c as l,a}from"./app-d39e0209.js";const d={},r=a('<h1 id="_23-december" tabindex="-1"><a class="header-anchor" href="#_23-december" aria-hidden="true">#</a> 23_December</h1><p>不知不觉已经十二月了，来了三个月了，好快，每天无聊着，时间也在不断飞逝。</p><h3 id="_2023年12月1日" tabindex="-1"><a class="header-anchor" href="#_2023年12月1日" aria-hidden="true">#</a> 2023年12月1日</h3><ul><li>今天主要是针对working periods划分的时间间隔的依据做了统计，程序基本写完了，还没有运行完，但是感觉结果不太好分析，好像选哪个时间都问题不大，到时候看看老师怎么说吧，先把图和数据准备好</li><li>下午开了党会，晚上吃的炒饭我还以为是梅干菜呢，结果是酸菜，蚌埠住了。</li><li>又到周末了，无聊到爆。</li></ul><h3 id="_2023年12月2日" tabindex="-1"><a class="header-anchor" href="#_2023年12月2日" aria-hidden="true">#</a> 2023年12月2日</h3><ul><li>今天把time interval threshold的程序写完了，后面根据需要在进行调整吧</li><li>然后把工程讲座的作业糊弄完了</li><li>蚌埠住了，和室友打游戏到半夜三点哈哈哈哈，然后还出去摊了店</li></ul><h3 id="_2023年12月3日" tabindex="-1"><a class="header-anchor" href="#_2023年12月3日" aria-hidden="true">#</a> 2023年12月3日</h3><ul><li>一觉睡到十点多，起来洗个澡就出去吃饭了</li><li>下午继续整理了一下time interval threshold的依据，感觉数据不太好说明，然后和老师沟通了一下数据采集的有矛盾的地方，后续再看。</li><li>傍晚然后把三维动画的作业1胡弄完了，看不懂c++ opengl代码写的啥玩意，复制粘贴就完事了</li><li>晚上和室友去了广场吃了馄饨，然后两人还各买了一份小吃，回来后，写了一下repo vs commit的基本逻辑，还没写完。</li></ul><h3 id="_2023年12月4日" tabindex="-1"><a class="header-anchor" href="#_2023年12月4日" aria-hidden="true">#</a> 2023年12月4日</h3><ul><li>今天又睡晚了，睡到了九点多快十点，早上根本起不来，上午起来后继续看了一下repo vs commit的代码，基本写好了，搜了一下RQ的设计相关论文</li><li>下午把需要审稿的论文看了，写的挺好，没看出来什么问题，然后还剩了一点时间，把time interval threshold的依据整理好了，然后跑了一下repo vs commit代码，发现服务器挂了，就去写了一下他的论文论述部分</li><li>晚上上完课继续完善了一下repo vs commit的论文论述，基本写好了，只需要插入数据进去了。然后学了一下RQ的设计，感觉问题不一样，RQ的设计很不同，后面再看吧。</li></ul><h3 id="_2023年12月5日" tabindex="-1"><a class="header-anchor" href="#_2023年12月5日" aria-hidden="true">#</a> 2023年12月5日</h3><ul><li>上午整理了一下RQ的设计，整理成了文档，然后继续跑了一下repo vs commit的程序</li><li>下午开了组会，然后写了一下审稿意见</li><li>晚上替室友上了课，然后回来继续把审稿意见写完了，然后重新去找了一下RQ设计参考论文，新招了两篇A类的论文，明儿在整理一下。</li><li>居然上午干了什么，我晚上写就不记得了，完全记不起来上午干了啥，我去，蚌埠住了</li></ul><h3 id="_2023年12月6日" tabindex="-1"><a class="header-anchor" href="#_2023年12月6日" aria-hidden="true">#</a> 2023年12月6日</h3><ul><li>上午水早八课</li><li>下午来实验室继续搜了一下RQ设计，实在不想看了，估计也差不多吧，感觉方法中没有什么很特别的设计可以用来做消融实验</li><li>晚上班上练歌，然后找了一下向量相似度衡量，感觉各种衡量方法的结果都差不多，估计是数据的问题（也不知道有没有问题）</li></ul><h3 id="_2023年12月7日" tabindex="-1"><a class="header-anchor" href="#_2023年12月7日" aria-hidden="true">#</a> 2023年12月7日</h3><ul><li>上午把RQ重新整理了一下，然后跑了一下node classification模型，调节了各种参数，发现都一样。</li><li>然后陷入了各种傻逼思考，整奔溃了，饭都不想去吃</li><li>晚上水课，然后回寝室当废物</li><li>真他妈没意思</li></ul><h3 id="_2023年12月8日" tabindex="-1"><a class="header-anchor" href="#_2023年12月8日" aria-hidden="true">#</a> 2023年12月8日</h3><ul><li>忘了写了，不记得干嘛了，好像就是在刷课，然后收集数据</li><li>周六也没写，反正没干啥，就是刷刷课，收集收集数据</li><li>周六还打了一个多小时球，和别人双打，虽然不认识他们，但是打的好爽，尽兴了，没带眼镜，他们长啥样都不知道</li></ul><h3 id="_2023年12月10日" tabindex="-1"><a class="header-anchor" href="#_2023年12月10日" aria-hidden="true">#</a> 2023年12月10日</h3><ul><li><p>上午睡觉</p></li><li><p>下午收集数据，刷课</p></li><li><p>晚上审了一篇论文，感觉这篇论文就是自己都放弃拯救了，随便投的</p></li></ul><h3 id="_2023年12月11日" tabindex="-1"><a class="header-anchor" href="#_2023年12月11日" aria-hidden="true">#</a> 2023年12月11日</h3><ul><li>上午睡不醒，起来后吧昨晚看的论文的板书写了</li><li>下午继续审了三篇短论文，然后找了一下Jstereocode的源码，找不到，之前的哪个版本有些元素分析不出来，难崩</li><li>服务器崩了一天了，晚上看着他好了，然后重新调整了一下GNN Link Prediction的代码，还没写完，服务器又崩了，什么垃圾服务器。然后就无所事事，写了一些论文的overleaf的框架。急急急国王，服务器能不能有点用啊，本来想着今天可以完成repo vs commit的数据验证，就可以开展后面的数据集整理工作了，结果寄寄寄。</li></ul><h3 id="_2023年12月12日" tabindex="-1"><a class="header-anchor" href="#_2023年12月12日" aria-hidden="true">#</a> 2023年12月12日</h3><ul><li>我了个豆，昨晚睡眠简直要升天了，想死，上午就没起来，起来洗个澡，洗个衣服就中午了</li><li>吃了饭到办公室，服务器好了，就跑了一个link predictio，还是没有效果，为啥啊，想不明白，node classification和这个不是一样的道理吗，为啥这个就不行</li><li>然后下午开组会，汇报论文审稿，然后针对一些数据集位置的变化，调整了一些小地方</li><li>晚上针对java code extraction，调整了Java的代码，直接保存到tsv文件中，不使用单独的java文件保存了，太费空间，然后java处理文件也很慢，然后扩展model的程序跑的是真慢啊</li><li>三个室友都感冒了，蚌埠住了，只剩我了，这流感哈哈哈哈还是传过来了</li></ul><h3 id="_2023年12月13日" tabindex="-1"><a class="header-anchor" href="#_2023年12月13日" aria-hidden="true">#</a> 2023年12月13日</h3><p>上午继续睡觉，早八课也没去上</p><p>下午重构了一下代码，因为之前的代码只考虑了mylyn一个项目，现在重构封装，增加了代码的重用性，然后针对RQ3的代码进行了初步的编写，等数据跑完就可以试着运行了，这java抽取代码跑的太慢了，也可能是数据量太大的问题，但是就是慢</p><p>晚上把两篇审稿意见写了提交了，写作真的不行，屎一样，然后没事做，写了一些RQ部分的论文，笑死，全靠ChatGPT，不过他写的好像也不是那么好，真的好烂啊，英文写作，蚌埠住了，后面再慢慢改吧</p><h3 id="_2023年12月14日" tabindex="-1"><a class="header-anchor" href="#_2023年12月14日" aria-hidden="true">#</a> 2023年12月14日</h3><ul><li>日常上午睡觉</li><li>下午继续重构了一下代码，然后没事干，继续写了一下论文的Evaluation部分，笑死，实验都还没开始做，还不一定能行，就开始写论文了。傻逼</li><li>他妈的，晚上真的崩溃了，尝试link prediction就是不行，算了算了，蚌埠住了，那个服务器的GPU还被人占了，需要手动指定GPU序号，真傻逼，不知道自己去找可以用的。</li><li>然后发现之前的数据收集程序有错误啊啊啊啊啊，扩展model的时候，重复扩展，真的很崩溃，重新来吧，还好发现了，我说怎么图越来越大。先用三个项目跑跑node classification把，别真的不行，别搞我心态啊，虽然我自己都觉得不是很可行。</li></ul><h3 id="_2023年12月17日" tabindex="-1"><a class="header-anchor" href="#_2023年12月17日" aria-hidden="true">#</a> 2023年12月17日</h3><p>这几天忘记写了，让我回忆干了啥</p><p>周五不记得干啥活了，好像是找了一下code embedding的其他方式，然后没搞定，只记得和室友出去剪头，然后吃牛排，然后回寝室摆烂了，那估计是没干什么正事。</p><p>周六的话，继续看embedding，然后找了glove，将code看成是text进行编码，然后搞到天昏地暗，没搞出来，回寝室搞到一点多，还是报错，崩溃。但是今晚和人打了羽毛球，可。</p><p>今天的话，总算是吧glove embedding给搞定了，然后准备将之前的坑补起来，还是需要数据预处理一下，这个今天也完成了。后面的话，针对astnn，类的embedding要改成从method和field pooling得到，这个周一再整，周一还要审一篇短论文，晕，今天就这样吧。</p><h3 id="_2023年12月18日" tabindex="-1"><a class="header-anchor" href="#_2023年12月18日" aria-hidden="true">#</a> 2023年12月18日</h3><ul><li>不知不觉又到晚上十一点多了，麻了，不过这几天确实把几个问题解决了，累也值了</li><li>上午起来后把前几天衣服洗了，洗个衣服累死个人，一直弯着腰，最后腿都站不住了。</li><li>中午过来后，就继续把data process的逻辑写了， 然后java tokens transfer的逻辑调通，然后在下午总算是把这两步给work done了。然后下午还把astnn的逻辑重构了，去掉了block sequence中间表示，本来就没用，还生成另一个多余的文件。然后跑的时候报错了。</li><li>晚饭回来，继续看报错，发现是DataFrame的apply方法会默认使用numpy，不适用于GPU的Tensor，然后改为了手动遍历。然后也解决了一些其他bug，终于是完整跑通了，今晚上把数据集准备好，明天上午在跑预测模型看看结果。</li></ul><h3 id="_2023年12月19日" tabindex="-1"><a class="header-anchor" href="#_2023年12月19日" aria-hidden="true">#</a> 2023年12月19日</h3><ul><li>上午九点就起来了，起来就洗澡，然后来实验室，跑prediction结果，到十二点多，终于跑好了，效果还行</li><li>下午睡醒开组会，然后和老师商讨了一下RQ的细节，直接把跨项目单独作为一个RQ，然后其他实验只在mylyn数据集上做</li><li>晚上写了一下methodology的论文部分，是真难写啊，晚饭也没吃，写三个多少小时，就写了一页，蚌埠住了，十点了，回去买东西吃去了。</li><li>最近搞得有点狠，每天都眼睛痛。</li></ul><h3 id="_2023年12月22日" tabindex="-1"><a class="header-anchor" href="#_2023年12月22日" aria-hidden="true">#</a> 2023年12月22日</h3><ul><li>又有几天不记得写了</li><li>周三上午水课，然后下午继续写了一下methodology，总算是差不多了，屎一样的东西，后面再改吧，然后晚上看了一下jstereocode工具，再改bug，他们之前的代码报错啊，不知道他们跑起来的，怎么做的实验，没改掉。</li><li>周四来继续改bug，改好了。然后jstereocode只能在本地跑，文件信息再服务器上，蚌埠住了，然后又要写程序从服务器下载文件到本地上，然后跑了一部分jstereocode插件，发现是能跑的，但是好麻烦，需要一个个项目自己打开，四千多个会死的，平均一分钟才两个，这得搞到啥时候。</li><li>今天上午来，是的将model和jestereocode联动分配，改了一会，是没啥问题的了，基本都能找到stereotype。然后就一直再下载文件到本地，然后本地跑jstereocode，麻了，搞了一天才搞了几百个，想死。</li><li>然后之前投的demo短论文被拒了，现在又要改，然后再投，然后还改了一下网络模型，发现效果还没那么好，还得是要一个全连接层，可能参数多一些，网络学习能力更强吧。然后针对RQ1的自己方法进行了embedding的训练，然后跑一下模型。</li></ul><p>哎，每天都呆的时间挺长，都感觉自己很忙，但是不知道再忙什么，感觉啥也没干一样，哎，妈妈说的也没错，只有你比别人都忙，不知道你在忙些什么，也没见有什么成果，做成了什么，哎，这一个月又快要结束了，希望这个能快点搞完吧。</p><h3 id="_2023年12月25日" tabindex="-1"><a class="header-anchor" href="#_2023年12月25日" aria-hidden="true">#</a> 2023年12月25日</h3><ul><li>周末去了杭州和学长吃饭，然后去了同学那，在同学那看了jstereocode和一篇论文</li><li>今天上午继续把论文看了</li><li>然后下午过来把jstereocode调通了，还是需要手动，然后晚上把baseline的方法基本走通了，之后就是把jstereocode完全跑一次，然后就可以进行后续的RQ实验了</li></ul><h3 id="_2023年12月26日" tabindex="-1"><a class="header-anchor" href="#_2023年12月26日" aria-hidden="true">#</a> 2023年12月26日</h3><ul><li>又到十一点多了，上午九点艰难起床，然后来到实验室，把baseline得前一千个model预测结果跑了一下，统计了一下数据，然后把tool demo得论文得模板重新调整了一下</li><li>下午开组会，汇报进度，审稿论文</li><li>开完会后和晚上都在弄jstereocode，终于弄了2000个了，还有两千个，看明天能不能弄完。</li><li>彻底成为牛马</li></ul><h3 id="_2023年12月27日" tabindex="-1"><a class="header-anchor" href="#_2023年12月27日" aria-hidden="true">#</a> 2023年12月27日</h3><ul><li>上午起床水课，在课上弄jstereocode，一直弄到下午四点多终于是把所有的弄完了。</li><li>然后晚上烦的死，特别烦自己不会social，明明很希望可以周围有人一起玩，但是却不愿意主动去交流，也不会交流，不知道和人聊什么，对于一些事情，还没参加就会觉得自己做不到，哎，真他妈废物。以至于看到别人可以欢声笑语，我会觉得很羡慕，进而觉得自己很废物，讨厌自己，对自己产生失望的心理和情绪。</li><li>一边烦，一边还要写审稿意见，哎，还不会写，英语怎么这麽垃圾啊，操。</li></ul><h3 id="_2023年12月28日" tabindex="-1"><a class="header-anchor" href="#_2023年12月28日" aria-hidden="true">#</a> 2023年12月28日</h3><ul><li>晚上睡不着，哎，然后上午睡过头了，十点半要开党会，急急忙忙起来，结果到的人好少</li><li>下午来实验室继续处理了一下baseline的代码，处理了一些细节，但是如何计算还是没有太懂，和与原论文差别有点大。</li><li>然后晚上就是写论文，基本就是在画图，画一个流程图花了几小时，然后写了部分的论文。</li></ul><h3 id="_2023年12月29日" tabindex="-1"><a class="header-anchor" href="#_2023年12月29日" aria-hidden="true">#</a> 2023年12月29日</h3><ul><li><p>晚上还是睡不着，自己就是在瞎焦虑，但是确实也是害怕，不知道自己能做什么来解决这种现状，所以更加焦虑。越发觉得自己不在状态，不喜欢自己，但是又不知道怎么改变，只能说太懦弱了吧，然后也胆小</p></li><li><p>下午来了继续写了会论文，把detaset部分也基本写好了，然后把tool demo的论文也调整了一下，不会写啊，哎，真不会写啊，看别人写的和自己的也不太一样啊</p></li><li><p>晚上太无聊了，课程作业水了，元旦假了，哎，又是要无聊的度过三天。</p></li><li><p>元旦这几天忘写了，那就写一块吧。</p></li><li><p>30号干啥了呢，想想，睡了一上午估计是，然后吃饭过来实验室摸鱼，把三维动画作业水了一下，然后跑了一下baseline方法，数值有点高，难崩，然后晚上和两个室友出去吃烤肉了，回来后就差不多十点了，然后和室友打游戏到两点。</p></li><li><p>31号继续睡一上午，然后吃了饭来实验室摸鱼，晚饭和室友去吃了饺子，然后逛了一下超市，回来实验室继续摸鱼，主要写了一下论文的related work部分，把一些参考文献引进来，服务器一直被占用，完全做不了，然后十点多回寝室，刷手机，然后又和室友打游戏到两点。</p></li><li><p>元旦最后一天，就放到下个月吧。然后这个月就结束啦。</p></li></ul><h3 id="总结" tabindex="-1"><a class="header-anchor" href="#总结" aria-hidden="true">#</a> 总结</h3><p>这个月的话，首先是审稿任务也不少，慢慢的审稿的速度也变快了。</p><p>然后是科研，一是把GNN的实验数据的收集工作做了验证和重新整理，得到了完整的实验数据集。二是把自己方法的逻辑走通，对code embedding的方式进行了调查和复现，复现的是两种简单的算法，应该说是复现起来简单，代码给全了的算法。三是，把baseline的论文的方法进行了复现和结果的统计。四是把论文的主体部分写了初稿，画了一些插图等等。</p><p>再次是之前投的tool demo被拒稿了，后面再看看调整一下，一月底再投到FSE demo去。</p><p>这一个月上中旬还是比较忙的，下旬由于服务器一直被占用，导致有点子摸鱼。其次就是精神有点不正常，没事的时候就瞎几把想这想那，除了内耗自己还是在内耗自己。人还得是开心，开心的时候就会忘记一切，不会有那些有的没的在脑海里上下翻腾。</p><p>总结：我！是！傻逼！hhhhhhhhhhh</p>',58),h=[r];function o(n,t){return e(),l("div",null,h)}const s=i(d,[["render",o],["__file","23_Dec.html.vue"]]);export{s as default};
